// const INCREMENT_COUNT = "INCREMENT COUNT";

import { INCREMENT_COUNT } from "./actionType";

export const incrementAction = (quantity, ) => {
    return {
        type : INCREMENT_COUNT,
        payload : quantity,
        id : prd_id
    }
}
